import Pdf from "./Pdf"

const Pdfs = ({list_pdfs}) => {
    return (
        <>
        {list_pdfs.map((pdf)=>(
           <Pdf key={pdf._id} pdf={pdf}/> 
        ))}
        </>
    )
}

export default Pdfs
